class Ad {
    final String id;
    final String addType;
    final String blogId;
    final String title1;
    final String image1;
    final String title2;
    final String image2;
    final String link1;
    final String link2;
    final String textAd;
    final String textLink;

    Ad({
        required this.id,
        required this.addType,
        required this.blogId,
        required this.title1,
        required this.image1,
        required this.title2,
        required this.image2,
        required this.link1,
        required this.link2,
        required this.textAd,
        required this.textLink,
    });

    factory Ad.fromJson(Map<String, dynamic> json) => Ad(
        id: json["id"],
        addType: json["add_type"],
        blogId: json["blog_id"],
        title1: json["title_1"],
        image1: json["image_1"],
        title2: json["title_2"],
        image2: json["image_2"],
        link1: json["link_1"],
        link2: json["link_2"],
        textAd: json["text_ad"],
        textLink: json["text_link"],
    );

    Map<String, dynamic> toJson() => {
        "id": id,
        "add_type": addType,
        "blog_id": blogId,
        "title_1": title1,
        "image_1": image1,
        "title_2": title2,
        "image_2": image2,
        "link_1": link1,
        "link_2": link2,
        "text_ad": textAd,
        "text_link": textLink,
    };
}
